// import classNames from 'classnames';

class Button extends React.Component {
  render() {
    console.log(this.props);

    return (
      <button
        className={classNames('button', {
          'button--outline': this.props.outline,
        })}>
        {this.props.text}{' '}
      </button>
    );
  }
}

export default Button;
